from typing import List


class Solution:
    def maxIncreasingSubarrays(self, nums: List[int]) -> int:
        n = len(nums)
        ans = 1
        left = 0
        prev_window_size = 1
        for right in range(1, n):

            if nums[right] <= nums[right-1]:
                prev_window_size = right - left
                left = right

            # Consider two situations here
            # 1/ Compare prev window with current window
            op1 = min(prev_window_size, right - left + 1)
            ans = max(ans, op1)

            # 2/ Just only current window
            op2 = (right - left + 1) // 2
            ans = max(ans, op2)

        return ans

